import React, { useEffect, useState } from "react";
import Weather from "../Weather/Weather.js";
import { getWeatherList } from "../../Api.js";
import "./Weathers.css";

const Weathers = (props) => {
    const [datas, setDatas] = useState([]);

    useEffect(() => {
        // Menangkap data result API dan menambahkan penanganan kesalahan
        getWeatherList()
            .then((result) => {
                setDatas(result);
            })
    }, []);

    console.log(datas);

    return (
        <div className="container-fluid">
            <h2 style={{fontFamily:"fantasy"}}>Perkiraan Cuaca Hari Ini di seluruh Indonesia</h2>
            <div id="cityRadar" class="map-legacy mapboxgl-map" data-language="id"><div class="mapboxgl-canary" style="visibility: hidden;"></div><div class="mapboxgl-canvas-container mapboxgl-interactive mapboxgl-touch-drag-pan mapboxgl-touch-zoom-rotate"><canvas class="mapboxgl-canvas" tabindex="0" aria-label="Map" role="region" width="1152" height="840" style="width: 576px; height: 420px;"></canvas></div><div class="mapboxgl-control-container"><div class="mapboxgl-ctrl-top-left"><div class="mapboxgl-ctrl mapboxgl-ctrl-group"><button class="mapboxgl-ctrl-zoom-in" type="button" title="Zoom in" aria-label="Zoom in" aria-disabled="false"><span class="mapboxgl-ctrl-icon" aria-hidden="true"></span></button><button class="mapboxgl-ctrl-zoom-out" type="button" title="Zoom out" aria-label="Zoom out" aria-disabled="false"><span class="mapboxgl-ctrl-icon" aria-hidden="true"></span></button></div></div><div class="mapboxgl-ctrl-top-right"></div><div class="mapboxgl-ctrl-bottom-left"><div class="mapboxgl-ctrl mapboxgl-ctrl-attrib mapboxgl-compact"><button class="mapboxgl-ctrl-attrib-button" type="button" aria-label="Toggle attribution"></button><div class="mapboxgl-ctrl-attrib-inner" role="list"><a href="https://www.mapbox.com/about/maps/" target="_blank" title="Mapbox" aria-label="Mapbox">© Mapbox</a> <a href="https://www.openstreetmap.org/about/" target="_blank" title="OpenStreetMap" aria-label="OpenStreetMap">© OpenStreetMap</a> <a class="mapbox-improve-map" href="https://apps.mapbox.com/feedback/?owner=accuweather-inc&amp;id=cjknc24na2o5u2sqoy0t8ku8a&amp;access_token=pk.eyJ1IjoiYWNjdXdlYXRoZXItaW5jIiwiYSI6ImNqeGtxeDc4ZDAyY2czcnA0Ym9ubzh0MTAifQ.HjSuXwG2bI05yFYmc0c9lw" target="_blank" title="Map feedback" aria-label="Map feedback" rel="noopener nofollow">Improve this map</a></div></div><div class="mapboxgl-ctrl" style="display: block;"><a class="mapboxgl-ctrl-logo" target="_blank" rel="noopener nofollow" href="https://www.mapbox.com/" aria-label="Mapbox logo"></a></div></div><div class="mapboxgl-ctrl-bottom-right"></div></div></div>
            <div className="weather">
                {datas.map((data) => {
                    return (
                        <Weather
                            id={data.id}
                            propinsi={data.propinsi}
                            kota={data.kota}
                            kecamatan={data.kecamatan}
                            // lat={data.lat}
                            // lon={data.lon}
                        />
                    );
                })}
            </div>
        </div>
    );
};

export default Weathers;
